import {Link} from "react-router-dom";

export default function Navbar() {
    return (
        <nav>
            <ul>
                <li><Link to='/'>aaa</Link></li>
                <li><Link to='/contact'>aaa</Link></li>
            </ul> 
        </nav>  
    )
}
